def count_intersecting_wires(n, poles):
    d2 = {}
    for i in range(n):
        (x, y) = poles[i]
        for j in range(i):
            item = poles[j]
            if x == item[0]:
                if 'inf' not in d2:
                    d2['inf'] = [x]
                elif x not in d2['inf']:
                    d2['inf'].append(x)
            else:
                slope = Fraction(y - item[1], x - item[0])
                c = Fraction(y, 1) - slope * Fraction(x, 1)
                if slope not in d2:
                    d2[slope] = [c]
                elif c not in d2[slope]:
                    d2[slope].append(c)
    z = 1
    ans = 0
    f = 0
    for k in d2:
        z += len(d2[k])
    for k in d2:
        x = len(d2[k])
        f = f + x
        ans += x * (z - f)
    return ans

